import React from 'react';
import { Cards, Charts, CountryPicker } from './Components';
import styles  from './App.module.css';

class App extends React.Components{
	render(){
		return(
			<div className="container">
			<Cards />
			<CountryPicker />
			<Charts />
			</div>
		)
	}
}
export default App;
